window.bookSummaryJSON = "<p>A forgotten colony of humans live on a water world circling a tiny, faded star on the edge of the galaxy. The crew of their newest flagship, the <i>Rampart</i>, encounters an alien scout who is being chased by a dangerous foe. The encounter shakes the beliefs held by the people of Lashmere. With the aid of the mysteries of the origin tablet, they discover the true origins of their colony. These may be the last humans in the universe. Can they survive against their ancient enemy? Their only choice is to embrace an unknown past and fight with everything they have. </p>"; 
